    public static Type GetDelegateType(Type returnType, int numArguments, int floatsBitmap)
    {
        string delegateTypeName = $"Func{TypeToTypeName(returnType)}Args{numArguments}";
        if (floatsBitmap != 0)
        {
            if (floatsBitmap > 0x0f)
            {
                // Floating-point arguments are only important up to the 4th args (= 4th bit)
                floatsBitmap &= 0x0f;
            }
            if (floatsBitmap != 0)
            {
                delegateTypeName += $"_f{floatsBitmap}";
            }
        }
        return typeof(FuncVoidArgs0).DeclaringType!.GetNestedType(delegateTypeName, (BindingFlags)0xffff);
    }

    private static string TypeToTypeName(Type type)
    {
        if (type == typeof(void))
            return "Void";
        else if (type == typeof(nuint))
            return "NUInt";
        else if (type == typeof(float))
            return "Float";
        else if (type == typeof(double))
            return "Double";
        else
            throw new ArgumentException("Unsupported return type.");
    }

    public static int GetFloatsBitmap<T>(IEnumerable<T> parameters, Func<T, bool> isFloatingPointType)
    {
        int floatsBitmap = 0x00_00_00_00;

        var enumerator = parameters.GetEnumerator();
        // More than 32 parameters is madness and we only care about the first 4.
        for (int i = 0; i < 32; i++)
        {
            if (!enumerator.MoveNext())
                break;
            T o = enumerator.Current;
            if (isFloatingPointType(o))
            {
                int bit = 1 << i;
                floatsBitmap |= bit;
            }
        }
        return floatsBitmap;
    }
